// Game object data structures
struct Ball {
    double r;
    double x;
    double y;
    double vel_x;
    double vel_y;
    double acc_x;
    double acc_y;
	double p_x;
    double p_y;
};

struct Obstacle {
    int x;
    int y;
    int w;
    int h;
};

struct Goal {
    int x;
    int y;
    int w;
    int h;
};


struct Mouse {
	int first_x;
	int first_y;
	int second_x;
	int second_y;
	int pressed;
	int first_click;
};

int strength = 1;

// Global vars for storing current game objects
struct Obstacle *current_obstacles; // Dynamic array
struct Ball current_ball;
struct Goal current_goal;

struct Mouse mouse;

const int obstacles_per_level[LEVELS] = {2, 1, 2, 4};
const struct Obstacle level_obstacles[LEVELS][4] = {
	{{.x = 110, .y = 90, .w = 40, .h = 60}, {.x = 170, .y = 90, .w = 40, .h = 60}},
	{{.x = 110, .y = 100, .w = 100, .h = 40}},
	{{.x = 110, .y = 79, .w = 10, .h = 160}, {.x = 210, .y = 0, .w = 10, .h = 160}},
	{{.x = 100, .y = 55, .w = 140, .h = 10}, {.x = 100, .y = 175, .w = 140, .h = 10}, {.x = 0, .y = 115, .w = 110, .h = 10}, {.x = 229, .y = 115, .w = 110, .h = 10}}
	
};

// Only contains initial X and Y of ball per level
const int level_balls[LEVELS][2] = { 
    {156, 220},
	{156, 220},
	{48, 200},
	{156, 225}
};
struct Goal level_goals[LEVELS] = {
    {.x = 155, .y = 20, .w = 10, .h = 10},
	{.x = 155, .y = 20, .w = 10, .h = 10},
	{.x = 270, .y = 20, .w = 10, .h = 10},
	{.x = 155, .y = 10, .w = 12, .h = 12},
};

// Physics functions declaration
void init_ball(int level);
void init_goal(int level);
void init_obstacles(int level);	
void init_mouse();
void update_physics(int level);
void apply_force(double force_x, double force_y);
void check_edges();
void check_collisions(int level);
int check_win_conditions(int level);
void clear_next_level();

// Graphic functions declaration
void wait_for_vsync();
void clear_screen();
void display();
void draw_rectangle(int x, int y, int w, int h, short int color);
void swap(int * a, int * b);
void plot_pixel(int x, int y, short int line_color) ;
void win_game();

// Control functions declaration
void check_ball_controls(int level);

int main(void) {
	// Inialize buffer
	volatile int *pixel_ctrl_ptr = (int *) 0xFF203020;
	
	/* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
	
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr; // pixel_buffer_start points to the pixel buffer
	
	clear_screen();
	
	/* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
	
	// we draw on the back buffer
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // pixel_buffer_start points to the pixel buffer
	
	// Start game
	int level;
    for(level = 0; level < LEVELS; level += 1) {
		
		// Clear screen for next level
		clear_screen(); 	
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		clear_screen(); 
		
		// Inialize level
        init_obstacles(level);
        init_goal(level);
        init_ball(level);
		init_mouse();
		
		// Game loop
        while(check_win_conditions(level) == 0) {
			//clear_screen();
			
			display(level); 
            update_physics(level);
            check_ball_controls(level); 
			
        }
		// Avoid memory leaks (dynamic array)
        clear_next_level(); 
    }
	// If all levels cleared win game
	win_game();	
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	
    return 0;
}



// Initial ball position for current level
void init_ball(int level) {
    current_ball.x = level_balls[level][0];
    current_ball.y = level_balls[level][1];
    current_ball.r = R;
    current_ball.vel_x = 0;
    current_ball.vel_y = 0;
}

// Goal location for the curren level
void init_goal(int level) {
    current_goal.x = level_goals[level].x;
	current_goal.y = level_goals[level].y;
	current_goal.w = level_goals[level].w;
	current_goal.h = level_goals[level].h;
}

void init_mouse() {
	mouse.pressed = FALSE;
	mouse.first_click = TRUE;
}

// Obstacles positions for the current level
void init_obstacles(int level) {
    current_obstacles  = (struct Obstacle*) malloc(sizeof(struct Obstacle) * obstacles_per_level[level]);
	int i;
	for(i = 0; i < obstacles_per_level[level]; ++i) {
		current_obstacles[i] = level_obstacles[level][i];
	}
}

void update_physics(int level) {	
	
	current_ball.p_x = current_ball.x; 
	current_ball.p_y = current_ball.y;
	
    // Apply constant forces (friction)
    double friction_x = -1.0 * FRICTION_CONSTANT * current_ball.vel_x;
    double friction_y = -1.0 * FRICTION_CONSTANT * current_ball.vel_y;
    apply_force(friction_x, friction_y);

    // Update velocity
    current_ball.vel_x += current_ball.acc_x;
    current_ball.vel_y += current_ball.acc_y;

    // Update position
    current_ball.x += current_ball.vel_x;
    current_ball.y += current_ball.vel_y;

	// Reset accelearation
    current_ball.acc_x = 0.0;
    current_ball.acc_y = 0.0;
	
	// Check for collisions
    check_edges();
    check_collisions(level);
}

// Applies a force to the ball
void apply_force(double force_x, double force_y) {
    current_ball.acc_x += force_x / MASS;
    current_ball.acc_y += force_y / MASS;
}

// Check if ball colided with edge of screen
void check_edges() {
    if(current_ball.x <= 0) { // left side
		current_ball.x = 1;
        current_ball.vel_x *= -1.0 * COLLISION_LOSS;
    } else if(current_ball.x + current_ball.r >= SCREEN_WIDTH) { // right side
		current_ball.x = SCREEN_WIDTH - current_ball.r - 1;
        current_ball.vel_x *= -1.0 * COLLISION_LOSS;
    }

    if(current_ball.y <= 0) { // top side
		current_ball.y = 1;
        current_ball.vel_y *= -1.0 * COLLISION_LOSS;
    } else if(current_ball.y + current_ball.r >= SCREEN_HEIGHT) { // bottom side
		current_ball.y = SCREEN_HEIGHT - current_ball.r - 1;
        current_ball.vel_y *= -1.0 * COLLISION_LOSS;
    }
}

// Check if ball collided with any obstacle
void check_collisions(int level) {
    int i;
    for(i = 0; i < obstacles_per_level[level]; i += 1) {
        int start_x = (current_obstacles + i)->x;
        int end_x = start_x + (current_obstacles + i)->w; 
        
		int start_y = (current_obstacles + i)->y;
        int end_y = start_y + (current_obstacles + i)->h; 
		
		double ball_left = current_ball.x;
		double ball_right = current_ball.x + current_ball.r;
		
		double ball_top = current_ball.y;
		double ball_bottom = current_ball.y + current_ball.r;
		
		double ball_center_x = current_ball.x + (current_ball.r/2.0);
		double ball_center_y = current_ball.y + (current_ball.r/2.0);
		
		// Hit from right
		if((start_x < ball_left && ball_left <= end_x) &&
		   (current_ball.vel_x < 0) &&
		   (start_y <= ball_center_y && ball_center_y <= end_y)) {
			current_ball.x = end_x + 1;
			current_ball.vel_x *= -1.0 * COLLISION_LOSS;
		}
		
		// Hit from left
		if((start_x < ball_right && ball_right <= end_x) &&
		   (current_ball.vel_x > 0) &&
		   (start_y <= ball_center_y && ball_center_y <= end_y)) {
			current_ball.x = start_x - current_ball.r - 1;
			current_ball.vel_x *= -1.0 * COLLISION_LOSS;
		}
		
		// Hit from top
		if((start_y <= ball_bottom && ball_bottom < end_y) &&
		   (current_ball.vel_y > 0) &&
		   (start_x <= ball_center_x && ball_center_x<= end_x)) {
			current_ball.y = start_y - current_ball.r - 1;
			current_ball.vel_y *= -1.0 * COLLISION_LOSS;
		}
		
		// Hit from bottom
		if((start_y < ball_top && ball_top<= end_y) &&
		   (current_ball.vel_y < 0) &&
		   (start_x <= ball_center_x && ball_center_x <= end_x)) {
			current_ball.y = end_y + 1;
			current_ball.vel_y *= -1.0 * COLLISION_LOSS;
		}
    }
}

// Check ball collided with goal (level won)
int check_win_conditions(int level) {
    int start_x = current_goal.x;
    int end_x = start_x + current_goal.w; 
	
	int start_y = current_goal.y;
    int end_y = start_y + current_goal.h; 
    
	double ball_center_x = current_ball.x + (current_ball.r/2.0);
	double ball_center_y = current_ball.y + (current_ball.r/2.0);
	
    if((ball_center_x >= start_x - 2 && ball_center_x <= end_x + 2) &&
	    ball_center_y >= start_y -2  && ball_center_y <= end_y + 2) { 
        return 1; // true
    }

	return 0;
}

// Free memory to avoid memory leaks
void clear_next_level() {
    free(current_obstacles);
}


unsigned char byte1 = 0;
unsigned char byte2 = 0;
unsigned char byte3 = 0;

int delay;

// Add apply force depending on mouse movement
void check_ball_controls(int level) {


	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

	int PS2_data, RVALID;

	PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
	RVALID = (PS2_data & 0x8000);	// extract the RVALID field

	if (RVALID != 0)
	{
		byte1 = byte2;
		byte2 = byte3;
		byte3 = PS2_data & 0xFF;
		
		//printf("Got: %d, %d, %d\n", byte3, byte2, byte1);
		
		if ((byte2 == (char)0xAA) && (byte3 == (char)0x00)) {
			*(PS2_ptr) = 0xF4;
		}
		
	}
	
	// Left key pressed
	if(byte3 == 0x09 || byte3 == 0x08) {	
		delay = 1;
	}
	
	if(delay == 1) {
		delay = 0;
	}
	
	if(delay == 0) {
		delay = -1;
		
		// On first click store x, y pos for start of force vector
		if(byte3 == 0x09 && mouse.first_click == TRUE) {
			mouse.first_x = byte1;
			mouse.first_y = byte2;
		}
			
		// On first click release start tracking mouse pos for end of force vector
		if(byte3 == 0x08 && mouse.first_x != -1) {
			mouse.second_x = byte1;
			mouse.second_y = byte2;
			mouse.first_click = FALSE;
		}
		
		// On second click press clear apply force and clear vars
		if(byte3 == 0x09 && mouse.first_click == FALSE) {
			// Calculate direction
			double dir_x = 1.0 * (mouse.second_x - mouse.first_x);
			double dir_y = 1.0 * (mouse.second_y - mouse.first_y);
			
			// Set max x limit
			if(dir_x >= 50) 
				dir_x = 50;
			else if (dir_x <= -50)
				dir_x = -50;
			
			// Set max y limit
			if(dir_y >= 50) 
				dir_y = 50;
			else if (dir_y <= -50)
				dir_y = -50;
			
			// Scale
			dir_x *= 32.0/50.0;
			dir_y *= 32.0/50.0;
			
			// Apply force
			apply_force(-dir_x, -dir_y);
			
			// Reset mouse
			mouse.first_x = -1;
			mouse.first_y = -1;
			mouse.second_x = -1;
			mouse.second_y = -1;
		}
		
		// On second click release reset mouse
		if(byte3 == 0x08 && mouse.first_click == FALSE && mouse.first_x == -1) {
			mouse.first_click = TRUE;
		}
	}
	

	
	//printf("x: %f, y: %f\n", current_ball.vel_x, current_ball.vel_y);
	
	// Ball can only moved if fully stopped
	if((ABS(current_ball.vel_x) < strength) && (ABS(current_ball.vel_y) < strength)) {

		//User presses W or Up
		if(byte3 == 0x1D || byte3 == 0x75){
			apply_force(0,-strength);
		}

		//User presses A or Left
		if(byte3 == 0x1C || byte3 == 0x6B){
			apply_force(-strength,0);
		}

		//User presses S or Down
		if(byte3 == 0x1B || byte3 == 0x72){
			apply_force(0,strength);
		}

		//User presses D or Right
		if(byte3 == 0x23 || byte3 == 0x74){
			apply_force(strength,0);
		}
	}
	
	//User presses R to reset position
	if(byte3 == 0x2D){
		current_ball.x = level_balls[level][0];
		current_ball.y = level_balls[level][1];
		current_ball.r = R;
		current_ball.vel_x = 0;
		current_ball.vel_y = 0;
		current_ball.acc_x = 0;
		current_ball.acc_y = 0;
	}
	
	// Control strength with 1-4
	if (byte3 == 0x16) 
		strength = 1;
	else if (byte3 == 0x1E) 
		strength = 2;
	else if (byte3 == 0x26) 
		strength = 4;
	else if (byte3 == 0x25) 
		strength = 8;
	
}

// Display graphics
void display(int level) {
	
	//Display ball 
	draw_rectangle(current_ball.x, current_ball.y, 
				   current_ball.r, current_ball.r, 
				   RED);

	// Display obstacles
	int i;
	for(i = 0; i < obstacles_per_level[level]; ++i) {
		draw_rectangle(current_obstacles[i].x, current_obstacles[i].y, 
					   current_obstacles[i].w, current_obstacles[i].h, 
					   WHITE);
	}
	
	
	// Display goal
	draw_rectangle(current_goal.x, current_goal.y, 
				   current_goal.w, current_goal.h, 
				   GREEN);
	
	
	// vsync
	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	
	//clear_screen();
	draw_rectangle(current_ball.p_x, current_ball.p_y, 
				   current_ball.r, current_ball.r, 
				   BLACK);
}

// Display something to show the game was finished
void win_game() {
	int i, j;
	for(i = 0; i < SCREEN_WIDTH; ++i){
		for(j = 0; j < SCREEN_HEIGHT; ++j){
			plot_pixel(i, j, gameover[j][i]);
		}
	}
}

// Black out screen
void clear_screen(){
	// Sets all pixels to black
	int i, j;
	for(i = 0; i < SCREEN_WIDTH; ++i) {
		for(j = 0; j < SCREEN_HEIGHT; ++j)
			plot_pixel(i, j, BLACK);
	}
}

void draw_rectangle(int x, int y, int w, int h, short int color) {
	int i, j;
	for(i = x; i < x+w; ++i){
		for(j = y; j < y+h; j++){
			plot_pixel(i, j, color);
		}
	}
}

void wait_for_vsync() {
	// Get pixel buffer
	volatile int *pixel_ctrl_ptr = (int *) 0xFF203020;
	int status;
	// launch the swap process
	*pixel_ctrl_ptr = 1;
	// poll he saus bi
	status = *(pixel_ctrl_ptr+3);
	while( (status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr+3);
	}
	// swap done, can exit
}

void swap(int * a, int * b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

void plot_pixel(int x, int y, short int line_color) {
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

